('R0102002', 1, 1, 3, 1201184138, 'fall seven times, stand up eight ', 3.55, 'to upgrade my self', 2),
('R0102003', 1, 1, 3, 1201184109, 'do the best and pray', 3.75, 'to improve my skill and learn to cooperate with other', 2),
