('R0102005', 1, 1, 3, 1201184145, 'Registration is the beginning to be a success people', 3.78, 'I want to be able to benefit others', 2),
('R0102006', 1, 1, 3, 1201180281, 'To be of good quality, you have to excuse yourself from the presence of shallow and callow minded individuals.', 3.33, 'I\'ve been in a Research Group of Vignette supervised by GTX Laboratory. There, I\'ve learnt a lot from them and got inspirations too as well. By then, I learnt about pressure and balancing my college life and the life outside college. They helped me progress and develop. I\'m also eager to learn, not only academically, but more in a wide-range of knowledge. These are why I feel the urge to apply as an Assistant Laboratory of GTX. Because, why not?', 2),
('R0102007', 1, 1, 3, 1201183382, 'Live is all about our perception', 3.91, 'Saya ingin mengembangkan diri saya jauh lebih dalam di bidang desain 2d dan 3d', 2),
('R0102008', 1, 1, 3, 1201184447, 'Life as you will die tomorrow', 1.9, 'I want to develop my skill at using editing software', 2),
('R0102009', 1, 1, 3, 1201184428, 'Be brave. Nothing can subtitute experience', 2.4, 'Every person deserve to be success, depend of their act', 2),
('R0102010', 1, 1, 3, 1201184401, 'Be kind, Be nice, Be fabulous', 3.55, 'my motivation for applying the position of technical drawing laboratory assistant is because i interested with all about graphic design or something like this. besides of that, i want to explore further about it and seek more experience. ', 2),
('R0102011', 1, 1, 3, 1201184061, 'no such thing as perfect, there\'s always a space to improve', 3.53, 'to be a better person, and useful to my surroundings', 2),
('R0102012', 1, 1, 3, 1201184282, 'Happy and helpful', 3.78, 'I want to prove that I am somebody, not everybody', 2),
('R0102013', 1, 1, 3, 1201184214, 'no dreams is too big no dreamers is too small', 2, 'i wanna breaks my limits, and i hope this could improving my skills on autodesk or maybe adobe haha', 2),
('R0102014', 1, 1, 3, 1201180008, 'there is a rainbow after the rain', 3, 'i want to be technical drawing laboratory assistant because i like about designing something and i want to share my knowledge with 2019 students. And i also want to improve my softskill like public speaking and others because it is very important, being laboratory assistant makes my free time less than my friend but i am sure that i can manage my time well', 2),
('R0102015', 1, 1, 3, 1201184293, 'The problem is not to be dealt with harshly,  but to be addressed patiently', 3.28, 'Let me introduction my self before , I am Ananda Julian Nugraha from TI-42-01.\r\nMy motivation is if I become GTX ASSISTANT, I want to be deeper into my knowledge and look for new experiences that will certainly be very useful in the future. Because I have followed VIGNETTE who is a research group with some special skills on there. It makes me push to explore more than a research group. My intention is to add knowledge and relation.\r\nBecause I am used to following the routine of a member of a res', 2),
('R0102016', 1, 1, 3, 1201180431, 'Do the best, be good, then you will be the best.', 3.75, 'I want to experience new stuff that is meaningful, useful, and beneficial, either for me or for others. Also, I want to share of what I know and learn things from others too.', 2),
('R0102017', 1, 1, 3, 1201180226, 'everything is better if you know how the world works', 3.68, 'I want to share my knowledge to others and use the new knowledge that i am getting from being an assistant for a better future', 2),
('R0102018', 1, 1, 3, 1201181142, 'You have the right to feel any emotion that you want, and to do what makes you happy.', 3.9, 'I adore how organized Technical Drawing Laboratory(GTX) is, how they manage to find an easy way to understand a difficult program. I want to be able to help others just like how the assistants helped me when im in trouble, i admire how patient they answered me even though i asked them so many questions and helped me step by step until i understand, i respect them by how humble the are even though theyre so smart. Im interested to step out of my comfort zone and become a useful person for everyon', 2),
('R0102019', 1, 1, 3, 1201184057, 'never give up', 3, 'i want to share my knowledge', 2),
('R0102020', 1, 1, 3, 1201182453, 'Never give up for what we want', 3.9, 'I want to learn more in there so I can share my knowladge to the other. I like and I really want to be the part of gtx lab, because they are really cool, discipline, and kind when there is someone ask', 2),
('R0102021', 1, 1, 3, 1201184316, 'you are what you think and you get what you do', 3.45, 'ada satu hal besar yang membuat saya termotivasi untuk menjadi asisten lab. gambar teknik. sebelum saya mendaftar rekruitmen ini banyak tahapan yang saya lalui, seperti saya harus belajar sekitar 7 modul untuk cukup mampu bekerja bersama inventor. satu langkah inilah yang membuat saya tertantang. bahkan ketika proses mendaftar saya sudah belajar dan berkembang lebih baik. hal ini memotivasi saya. saya yakin satu langkah kedepannya pun akan membuat saya berkembang tumbuh menjadi orang yang mampu ', 2),
('R0102022', 1, 1, 3, 1201180323, 'If you only do what you can do, you’ll never be better than what you are', 3.4, 'I want to be an assistant at the GTX laboratory because I want to re-teach what I have learned to the junior later. I also want to learn more about technical drawings. from the beginning I was a practitioner of the GTX laboratory I got a fairly low score and I was afraid that I could not get good grades in the following lab work. But I try to learn and it turns out that by learning I can get good grades until finally I can enter into the top 10. indeed at first I was pessimistic to get good grad', 2),
('R0102023', 1, 1, 3, 1201180172, 'It\'s not who you are, it\'s what you do that defines you', 3.18, 'Work hard to earn achievements', 2),
('R0102024', 1, 1, 3, 1201184275, 'How hard  your life was going, just keep never quit', 3.68, 'If i am the next big things i will try as best of me to be useful people around me.If i am the next big things,i will fix something that must be fixen.And if i am the next big things,i will lead my self to be a role model even when i\'m dead.I will sarcrife my life to be kind and share love to everyone,so i can make peaceful and comfortable world.', 2),
('R0102025', 1, 1, 3, 1201182473, 'Do the best or go home', 2.68, 'I want to upgrade my drawing skill and learn a lot about 2D and 3D drawing.', 2),
('R0102026', 1, 1, 3, 1201184284, 'one leave is better then one gold', 3.5, 'I really want to add capabilities in this lab , and get a lot of experience', 2),
('R0102027', 1, 1, 3, 1201184173, 'There is no limit of struggling', 2.6, 'I need to learn about 2D/3D Software, because i like this but i need to practice more', 0),
('R0102028', 1, 1, 3, 1201184032, 'experience is the best teacher', 3.6, 'want to expand my experience and knowledge for the future', 2),
('R0102029', 1, 1, 3, 1201180176, 'Make a Decision, and don\'t look back', 3.93, 'my motivation for applying as GTX Assistant is I want to apply my skill in 2D and 3D CAD software and increase my skill in 2D and 3D CAD software. Beside, I  can work under pressure individually and in a group.', 2),
('R0102030', 1, 1, 3, 1201184312, 'Jangan menyerah sebelum mencetak sejarah', 2.8, 'I want to expertise my 3D design/drawing also make new partners and make cooperation with them', 2),
('R0102031', 1, 1, 3, 1201180407, 'rest when you finish something, not when you tired.', 1.75, 'motivasi saya ingin menjadi asslab gartek karena saya sangan suka lab gtx gambar teknik, walaupun saya tidak pernah masuk top 10 selama mengikuti praktikum tetapi saya tidak mementingkan itu, saya suka mendesain sesuatu di gambar teknik ini. kedepanya saya ingin lebih mengetahui tentang apa yang dipelaari di praktikum gambar teknik, dan saya ingin memelajari software lainnya yang ada disini. ', 0),
('R0102032', 1, 1, 3, 1201181375, 'Everything is gonna be okay', 3.23, 'I want share knowledge', 2),
('R0102033', 1, 1, 3, 1201184125, 'Hidup seperti hujan yang tak kenal sakit walaupun sering jatuh', 3.83, 'Motivasi saya untuk mengikuti rekruitasi asisten lab GTX ini adalah untuk membagi ilmu saya kepada praktikan nantinya juga berlatih softskill saya seperti berbicara didepan banyak orang serta terus belajar untuk menggunakan berbagai aplikasi lainnya selain inventor dan autocad, serta saya ingin bisa lebih disiplin lagi dan bisa untuk manage/mengatur waktu saya antara waktu kuliah, asisten lab, keluarga, agama, dan waktu diri sendiri.', 2),
('R0102034', 1, 1, 3, 1201184229, 'Practice makes perfect', 3.4, 'To sure you can do thing that you never done before', 2),
