('R0102040', 1, 1, 3, 1201183319, 'If you never try you never know', 3.03, 'I want to joint GTX lab because im curious in technical drawing things. Before I didnt know that Autodesk was exist at all! Now that I\'m interested in it, I just want to explore more about technical drawing even more. thats why I apply for GTX', 2),
('R0102041', 1, 1, 3, 1201174329, 'Don\'t limit your challenges, challenge your limits!', 3.52, 'To teach for new generation', 2),
