('R0202000', 2, 1, 2, 1201164205, 'Be what you wanna be, not everyone want to see', 2, 'Alasan saya untuk menjadi asisten laboratorium tekno ekonomi ini adalah karena memang saya memiliki niat untuk menjadi asisten laboratorium. Mengapa aslab? Karena saya fikir menjadi asisten laboratorium bisa membuat diri saya lebih bisa mengimprove dan mengupgrade dalam hal” yang penting dalam kehidupan. Seperti\r\nmemanage waktu, mempelajari ilmu dan mendalaminya.', 2),
('R0202002', 2, 1, 2, 1201164487, 'Be Your Self ', 3.21, 'Motivasi saya mengikuti rekruitasi lab tekmi  adalah : Pertama, sejak dari awal mengenal lab tekmi, saya sudah mempunyai goals (tujuan) untuk bisa menjadi bagian dari keluarga asisten laboraturium tersebut, selanjutnya adalah saya ingin melatih diri sendiri  untuk berorganisasi dalam bidang akademik, saya ingin berbagi ilmu pengetahuan yang saya tahu, saya ingin berbagi pengalaman, dan ingin lebih mendalami ilmu-ilmu yang ada dilab tersebut,karena saya lebih menyukai ilmu ekonomi.', 2),
('R0202003', 2, 1, 2, 1201164007, 'i do i can', 3.03, '1. ingin menjadi bagian dari tekmi lab untuk mengembangkan kemampuan yang saya punya.\r\n2. menambah pengalaman\r\n3. menambah relasi \r\n4. menyukai dan mengikuti dengan baik selama praktikum tekmi', 2),
('R0202004', 2, 1, 2, 1201164390, 'Success a needs process', 3.68, 'Make a difference today', 2),
('R0202005', 2, 1, 2, 1201164330, 'Saya tidak butuh kepercayaan dari anda, yang saya butuh adalah apakah anda bisa di percaya', 3.49, 'Untuk Techno Economy Laboratory\r\nAssalamualaikum wr.wb\r\n\r\nKreativitas dan antusias pilihan saya: Saya memiliki antusias untuk menjadi asistent Techno Economy Laboratory. Ambisi saya adalah untuk belajar lebih dalam matakuliah yang di ampuh oleh Techno Economy Laboratory. Selain mendapatkan ilmu yang lebih banyak, saya akan memberikan ilmu kepada orang yang di sekitar untuk menunaikan kewajiban sebagai manusia. \r\n\r\nTujuan dari hidup saya adalah ingin membahagiakan orang tua saya. Saya memiliki am', 2),
('R0202006', 2, 1, 2, 1201164094, 'Talk Less, Do More', 3.74, 'Ingin menantang diri sendiri, menggali dan mengembangkan potensi diri, dan membagi pengetahuan yang saya miliki. ', 2),
('R0202007', 2, 1, 2, 1201164074, 'Learn from the past, live for today and plan for tomorrow.', 3.06, 'To increase my knowledge, share knowledge about the techno economy that I have learned, and be more a better individual by becoming techno economy laboratory assistant', 2),
('R0202008', 2, 1, 2, 1201164166, 'chill', 2.82, 'Saya tertarik dengan ekonomi di bidang teknik dari pelajaran di kelas dan juga praktikum yang saya lakukan. Sehingga saya ingin belajar lebih dalam lagi, dan menurut saya menjadi bagian dari asisten lab tekmi adalah tempat yang tepat.', 2),
('R0202009', 2, 1, 2, 1201164243, 'All is well', 3, 'if i be the next assistant techno economy i’ll give my best and i”ll never make some mistake to bring techno economy laboratory down ', 0),
('R0202010', 2, 1, 2, 1201164050, 'Choose without regret', 2.94, 'My motivation is to develop my self in academy, and i want to explore my knowledge, and the last is i want to be more disciplne for my self by becoming an techno economy laboratory assistant.', 2),
('R0202011', 2, 1, 2, 1201164172, 'hal besar tidak bisa menjadi besar tanpa hal kecil didalamnya', 2.91, 'because i want to develop my skill in this course, and i want to know more about this laboratory ', 2),
('R0202012', 2, 1, 2, 1201164124, 'Embrace your challenge', 3.12, 'Saya sangat tertarik dalam bidang ekonomi, dan ingin terus menggali ilmu dalam bidang ini serta membagikannya kepada orang lain.', 2),
('R0202013', 2, 1, 2, 1201164076, 'Hidup itu pilihan', 3.03, 'Tidak ada usaha yang sia-sia.', 2),
('R0202014', 2, 1, 2, 1201164395, 'bismillahirahmanirohim ', 3.45, 'ingin menambah pengalaman, \r\ntertarik dengan laboratorium ini karena lab ini menurut saya cukup bermanfaat untuk dunia kerja \r\ningin membagi pengetahuan dan belajar untuk membimbing adik tingkat dalam mata kuliah praktikum ekonomi teknik \r\ningin menambah relasi \r\n ', 2),
