('R0402028', 4, 1, 4, 1201174194, 'Lebih baik mencoba, daripada tidak sama sekali', 3.32, 'In Telkom University they have Laboratory that concern to Industrial Statistic and Operational Research called SIPO Laboratory. for me I really enjoy to learn that’s lesson about operational research like decision tree lesson who can make the best decision from some decisions on several probabilities, then I like transportation lesson who can minimize cost in transportation with several method like North West Corner Method, Least cost. Etc, and then I like dynamic programming which the mathemati', 2),
('R0402029', 4, 1, 4, 1201174399, 'keberanian untuk berhasil harus lebih besar daripada ketakutan untuk gagal', 2.17, 'Untuk Mempelajari SIPO lebih dalam dan juga mencari pengalaman menjadi aslab, dan ingin berbagi ilmu dengan praktikan', 2),
('R0402030', 4, 1, 4, 1201170285, 'hidup itu jangan takut salah, jangan takut kalah, dan jangan pernah patah soalnya aku yakin semua yang udah kita lakuin dan bakal kita lakuin udah diatur semuanyah', 3.68, 'sebelumnya maaf kalo motivasi saya rasanya terlalu banyak. berikut merupakan motivasi saya untuk menjadi keluarga kecil lab SIPO. yang pertama dan paling utama adalah saya mau ngebanggain orang tua, soalnya orang tua saya mau banget ngeliat anaknya jadi orang yang sibuk di ranah pendidikan.\r\nyang kedua saya sangat mau memperluas ilmu saya tentang statistik, karena jujur saya sangat suka matematika tapi baru bertemu dengan statistika, jadi karena wawasan saya masih kurang memuaskan saya merasa bu', 2),
('R0402031', 4, 1, 4, 1201170211, 'never miss 100% of the shots you don\'t take', 3.15, 'Hal yang paling saya inginkan adalah saya ingin melanjutkan ikatan yang telah terbentuk saat saya berada di study group SIPO, masih banyak hal yang ingin saya lakukan. Menjalin dan memperkuat chemistry yang telah terbentuk, berbagi dan mempelajari ilmu yang belum pernah saya dapatkan itu merupakan suatu kemewahan bagi saya. Ketika amanah tersebut diberikan, saya dapat melatih kemampuan, belajar, mendapatkan pengalaman yang lebih, dan mengamalkan ilmu yang telah saya dapatkan.', 2),
('R0402032', 4, 1, 4, 1201170392, 'Live your life with no regrets', 3.72, 'Motivasi saya mengikuti rekruitasi asisten ini adalah karena saya ingin menambah pengalaman dan bekal, serta ingin meningkatkan rasa percaya diri saya agar dapat mengembangkan diri saya lagi.', 2),
('R0402033', 4, 1, 4, 1201174375, 'No regrets.', 3.68, 'I want to do great things while I still can and never having any regrets about it.', 2),
('R0402034', 4, 1, 4, 1201174065, 'Honesty, Diligence, Huminity', 3, 'Menjadi seorang asisten laboratorium merupakan hal yang sangat membanggakan sekaligus menjadi beban tersendiri terutama bagi orang awam seperti saya yang belum memiliki pengalaman di bidang tersebut. Seorang asisten laboratorium memiliki tanggung jawab yang sangat besar sehingga haruslah bisa mengemban tugas dengan baik dan tekun dalam melakukan sesuatu. Menjadi seorang asisten laboratorium bukan hanya sekedar membantu dosen saja tetapi juga harus bisa memberikan suatu inovasi agar laboratorium ', 2),
('R0502000', 5, 1, 5, 1201174230, 'Filosofi Semut', 3.61, 'Saya ingin memulai sesuatu yang lebih besar, selalu ada keinginan untuk menjadi seorang yang lebih baik lagi dan berguna untuk orang banyak. Dan saya percaya bahwa dengan menjadi seorang yang lebih baik dari sebelumnya itu memerlukan proses yang tidak mudah', 2),
('R0502001', 5, 1, 5, 1201174071, 'Allah is always beside me', 3.46, 'SISPRO is not my first practicum lab during my collage after 4th semesters. But, sispro is the first laboratory, who took my heart to become an assistant laboratory in this lab, I don’t know why, I really enjoy the practicum without feeling afraid, for me this is lab is so exciting than other practicums, the assistant laboratory are so kind. I hope if I become an assistant laboratory in this lab, I can become a nicer person, can increase my knowledge and know more my study in majoring Industrial', 2),
('R0502002', 5, 1, 5, 1201170204, 'Do everything with high efforts', 3.85, 'Hoping that I can implement my experience, my knowledge, and my efforts on a great and good things. I have high motivation in production section of the industry. That\'s why I choose Production System & Automation Laboratory to implement my all I have and all of my efforts.', 2),
('R0502003', 5, 1, 5, 1201174123, 'Vision without execution is hallucination', 3.84, 'I want to be a useful human being by sharing my knowledge to others', 2),
('R0502004', 5, 1, 5, 1201173043, 'Man Jadda Wajada', 3.75, 'I want to be a human that can help to each others and continues provide innovation to contribute to the country', 2),
('R0502005', 5, 1, 5, 1201170314, 'Hardwork beats talent when talent doesn\'t work hard', 3.96, 'I am highly motivated to be an assistant is because ever since I got into college, I have always wanted to be one, but at that time when I was in 1st semester, I had no idea which laboratory I would like to be part of. Then I started doing some research on several industrial engineering-related studies. I was intriqued in learning about production system after Industrial Game and INCREASE competition. With this, I convince myself to apply for this position as a SISPROMASI Laboratory Assistant be', 2),
('R0502006', 5, 1, 5, 1201174363, 'Work hard,play harder', 3.2, 'Saya tertarik menjadi bagian core dalam suatu manufaktur yaitu mengintegrasikan,merencanakan dan mengontrol jalannya proses produksi dan bidang itu saya pelajari di matkul Production Planning Control,saya juga tertarik untuk menjadi aslab dan menambah pengalaman baru + pengetahuan baru dalam bidang ini', 2),
('R0502007', 5, 1, 5, 1201174143, 'If we stop trying, that means we are not better than a coward', 3.85, 'I want to get more experience in production system', 2),
('R0502008', 5, 1, 5, 1201174167, 'Take it easy, everything will be okay', 3, 'Perkenalkan nama saya Anissha Ayu Purwantina. Saya berasal dari kota kecil di Jawa Timur yaitu Ponorogo. Saya anak ke tiga dari tiga bersaudara. Saya tinggal di jalan Sukarno Hatta 49b Ponorogo Jawa Timur sedangkan alamat kost saya yaitu jalan Sukabirus gang H.Atmawigena nomor 76 Bandung. Dalam tiap diri seseorang pasti memiliki kekurangan dan kelebihannya masing-masing. Kelebihan yang saya miliki yaitu saya dapat diandalkan, ontime, dapat bekerja dibawah tekanan dan konsiten. Sedangkan kelemaha', 2),
('R0502009', 5, 1, 5, 1201170315, 'you cannot grow if you are bitter.', 2.91, 'saya merasa lab sispromasi mampu menjadi wadah saya untuk mengembangkan skill saya. saya termotivasi untuk menjadi pribadi yang lebih bermanfaat untuk banyak orang sekitar saya dengan menyalurkan ilmu yang saya miliki. Sepanjang masa perkuliahan saya saya selalu dianggap sebelah mata, saya ingin membuktikan bahwa saya mampu.', 2),
('R0502010', 5, 1, 5, 1201174016, 'Keep trying, because you will never know which obstacles will lead you to success.', 2.88, 'I want to be a useful person for others, like sharing my knowledge. I want to expand my skills in teamwork, communication skill also.', 2),
('R0502011', 5, 1, 5, 1201170122, 'The best of us is the most beneficial for others', 3.43, 'Nothings are too small to dream and i really dare to achieve it.', 2),
('R0502012', 5, 1, 5, 1201170113, 'DO WHAT IS RIGHT, NOT WHAT IS EASY', 3.7, 'I want to realize my parent\'s hope, being part of laboratory of Production system and Automation-one of my hopes too. I want to prove to everyone who has underestimated me, that is nothing impossible in this world, if we want to try and pray. And I want to learn more about production system and automation and share to other. Also, I want to be confident, have a good experiences, improve my soft skill and hard skill, and the last one is being someone who means something to other.', 2),
('R0502013', 5, 1, 5, 1201174370, 'Do Perfect Thing As You Can', 3.68, 'menjadi bagian dari laboratrium sispromsi sebgai jembatan untuk mencapai mimpi di masa depan', 2),
('R0502014', 5, 1, 5, 1201174217, 'If you never try, you will never know.', 3.34, 'Karena ingin mencoba pengalaman baru, karena saya tau apapun yang tidak saya coba maka saya tidak pernah tau hasil apa yang akan saya dapatkan.', 2),
('R0502015', 5, 1, 5, 1201174236, 'Life is more than just feeding your ego.', 3.46, 'I want to make my parents proud of me and being able to give something to society.', 2),
('R0502016', 5, 1, 5, 1201170265, 'Set your life up to win!', 3.28, 'I wish I could improve my hardskills and softskills, network, and opportunity to understand everything about production system and automation. It will be profitable for me after this college', 2),
('R0502017', 5, 1, 5, 1201174404, 'GO FOR IT & BE SCARED. no matter how it ends, do it anyway', 3.09, 'FEAR=\r\nForget Everything And Run/\r\nFace Everything And Rise', 2),
('R0502019', 5, 1, 5, 1201174436, 'Success need process', 3.32, 'Jika aku diterima menjadi aslab aku akan banyak belajar di dalam tugas-tugas dengan atmosfer manufaktur sekali dan itu akan sangat berguna didunia kerja nanti. aku juga percaya ini bagian dari proses aku menjadi sukses', 2),
('R0502020', 5, 1, 5, 1201170418, 'reach your opportunity, because you only live once', 3.25, 'I want to improve my skill, especially in this lab very related with industrial engineering knowledge. and I want to train my teamwork in this lab', 2),
('R0502021', 5, 1, 5, 1201174221, 'hidup tidak hanya tentang senang maupun sedih', 3.54, 'kuliah tidak hanya belajar, melainkkan harus ber organisasi, disini saya ingin mencari jati diri saya untuk masa depan yang lebih bagus', 2);
INSERT INTO `oprec_general` (`id_oprec_gen`, `id_oprec`, `id_major`, `id_lab`, `nim`, `motto`, `gpa`, `motivation`, `oprec_status`) VALUES
('R0502022', 5, 1, 5, 1201174470, 'Bahagia Dunia dan Akhirat', 3.6, 'Saya ingin mempelajari lebih dalam mengenai sistem produksi dan otomasi. selain itu, ingin mempunyai karakter dan mengembangkan soft skill untuk diterapkan saat bekerja. ', 2),
('R0502023', 5, 1, 5, 1201170415, 'do the best', 3.32, 'i\'m born to be ready', 2),
('R0502024', 5, 1, 5, 1201170439, 'Take it easy', 2.4, 'I want to become useful for other people', 2),
('R0502025', 5, 1, 5, 1201170059, 'Dream will come true, while you believe in your dreams and never give up. ', 3.39, 'menjadi asisten merupakan salah satu goal saya, saya ingin memanfaatkan masa muda saya dengan hal-hal positif, setidaknya dengan berbagai kegiatan yang dapat mengembangkan potensi diri saya. salah satunya dengan menjadi asisten di laboratorium SISPROMASI ', 2),
('R0502026', 5, 1, 5, 1201174369, 'Lebih baik menyesali pilihan, daripada menyesal tidak memilih', 2.75, 'Ingin mencapai target tertinggi yang telah ditentukan dan selau memiki kemauan yang kuat untuk terus berubah menjadi lebih dari diri yang sekarang.', 2),
('R0502027', 5, 1, 5, 1201174011, 'Jangan membuat sulit sesuatu yang sudah mudah', 3, 'Saat saya masuk di Teknik Industri saya merasakan ini adalah sebuah kesalahan pilihan , namun dengan kesalahan pilihan saya itu saya berusaha dan belajar menghasilkan hasil yang terbaik dengan memantapkan tujuan saya . Tujuan saya mendaftar rekruitasi ini saya menginginkan  pada rekruitasi  ini saya bisa banyak belajar hal-hal yang sebelumnya belum saya temui dan nantinya akan menjadi tujuan akhir saya.', 2),
('R0502028', 5, 1, 5, 1201174160, 'Dream it, wish it, do it.', 3.69, 'Being a Laboratory Assistant is not an easy thing, many challenges must be faced, will always be required to create new things or fix a problem. It has become the basis of Industrial Engineering. In my opinion, I had the opportunity for this because from the experience of my friends who got a lot of knowledge in group research before, therefore I also wanted to be useful to my friends, and the whole community.\r\nMany say that the Sispromasi represents all Industrial Engineering, by getting knowle', 2),
('R0502029', 5, 1, 5, 1201174335, 'There\'s no limit of Struggling', 3.3, 'My family brought me here to Telkom University to meet my world and new family in SISPROMASI, my family always support me to get your chance to be an assistant, because be and assistant is a good job to do, no matter how the obstacle is, all i wanna do is serve, helping , and develope our skill, our softskills, our professionality, our work, and we will be a great family.', 2),
('R0502030', 5, 1, 5, 1201174146, 'hidup haruslah dengan usaha dan doa', 2.45, 'i will make sispromasi lab to the top ', 2),
('R0602000', 6, 2, 10, 1102120007, 'asasasa', 3.5, 'asdfdasda', 2),
('R0602002', 6, 1, 10, 1201170025, 'Take Your Own Happiness', 3.04, 'I want to develop myself, I want to fill my time with useful or positive activities, and get more experience. Furthermore, I want to gain more knowledge and share it with other people, so I can be an useful person for people around me.', 2),
('R0602003', 6, 1, 10, 1201174313, 'Talk Less Do More', 3.41, 'Motivasi saya  mengabdi sebagai asisten laboratorium adalah untuk mendapatkan pengalaman dan pengetahuan yang nantinya bisa saya tulis pada CV saat mendaftarkan pekerjaan, mengejar mimpi saya untuk lulus dengan predikat cumlaude, dan sebagai mahasiswa saya juga ingin apa yang saya lakukan bisa bermanfaat untuk fakultas dan jurusan saya, dan tentunya saya senang bisa membagi ilmu yang saya punya kepada banyak orang. Adanya praktikum algoritma dan pemrograman komputer, basis data, dan APSI, membua', 2),
('R0602004', 6, 1, 10, 1201174379, 'Always Believe in Allah SWT', 3.62, 'I want to explore this world by knowing the new things that what can i learn', 2),
('R0602005', 6, 1, 10, 1201174255, 'Jalani dan nikmati', 2.5, 'Ingin menambah pengetahuan yang baru dan membagi pengetahuan yang telah mengerti', 2),
('R0602006', 6, 1, 10, 1201174086, 'Think As Big As Galaxy', 3.38, 'Algorithms And Computer Programming is one of the existing courses in Industrial Engineering, Telkom University. Many students have difficulty learning and understanding the material in this course. Many students who get scored low in this course and there are even students didn’t pass in this course. So I want to join this program so that the knowledge I get can be useful, when in my career or in college.\r\nIf I become a member of the Enterprise System Engineering Laboratory, I want to deepen ab', 2),
('R0602007', 6, 1, 10, 1201174200, 'Lillahi Ta\'ala', 3.73, 'Saya ingin mengasah skill dalam bidang information technology (IT) dan membagikan ilmu saya kepada orang lain', 2),
('R0602008', 6, 1, 10, 1201170237, 'Allah tidak akan membebani seseorang diluar batas kemampuannya', 3.31, 'Selama saya mengikuti praktikum, saya merasa orang-orang yang dapat merancang sesuatu seperti membuat aplikasi dengan sebuah program adalah seseorang yang sangat hebat, dan saya ingin menjadi salah satu dari orang hebat itu.', 2),
('R0602009', 6, 1, 10, 1201174338, 'Selalu Optimis', 2.75, 'Karena saya ingin mencoba pengalaman baru, menambah wawasan, ilmu pengetahuan, dan ingin memperdalam tentang algoritma pemgrograman ', 2),
('R0602010', 6, 1, 10, 1201164269, 'selalu bertanggung jawab setiap harinya', 3.43, 'saya ingin menjadi bagian dalam keluarga lab ensyse dan ingin membawa lab ensyse menjadi lab yang tebraik di TI. tak terkecuali saya ingin mengembangkan ilmu yang sudah saya dapatkan dari matkul alpro dan basdat.', 2),
('R0602011', 6, 1, 10, 1201174181, 'tidak ada yang mustahil selama kita berusaha', 2.68, 'jika kita dapat menguasai IT maka dunia masa depan akan dapat di taklukan', 2),
('R0602012', 6, 1, 10, 1201174016, 'Keep trying, because you will never know which obstacles will lead you to success.', 2.88, 'I want to be a useful person to others, like sharing my knowledge. I want to expand my skills in teamwork, communication skill also.', 2),
('R0602013', 6, 1, 10, 1201174317, 'Dare to Dream Big', 3.39, 'my motivations for bigger things:\r\n1. I believe that God will give the best way\r\n2. I want to always be able to delight my parents, family, and friends\r\n3. I am happy to challenge myself\r\n4. I want to always be able to help others\r\n5. I want to work with other people\r\n6. I want to have more responsibilities\r\n7. I want to get the best output from every step I take\r\n8. I want to have provisions in my work later\r\n9. I want to be trusted by my colleagues for the effort that I have given', 2),
('R0602014', 6, 1, 10, 1201174300, 'MAN JADDA WAJADA', 3.56, 'I want to challenge myself by being a part of Enterprise System Engineering. I want to always be able to help others and i want to have more responsibility.', 2),
('R0602015', 6, 1, 10, 1201173058, 'Think Smart', 3.55, 'saya mengikuti rekruitasi asisten ini yang paling utama adalah saya ingin mengasah skill saya dan juga ingin mendapatkan ilmu yang lebih dari lab Ensyse sendiri dan juga tentunya menjadi seorang asisten adalah impian yang harus saya capai.', 2),
('R0602016', 6, 1, 10, 1201174075, 'Even though it\'s small, keep making improvement', 3.47, 'Become a part of change, and do that are meaningful to other', 2),
('R0602017', 6, 1, 10, 1201174077, 'Live on my life', 3.16, 'ingin eksplorasi lebih banyak tentang algoritma, karena sekarang dan masa yang akan datang akan lebih baik jika bisa menguasai teknologi, dan pemrograman adalah salah satu bagiannya', 2),
('R0602018', 6, 1, 10, 1201174084, 'Man Jadda Wajada', 3.36, 'I want to serve my community and my country', 2),
('R0602019', 6, 1, 10, 1201170433, 'Be myself', 2.97, 'Berubah lebih baik mulai dari diri semdiri', 0),
('R0602020', 6, 1, 10, 1201174240, 'DO THE BEST DON\'T REGRET', 3.47, 'CREATE A LOT OF MEANINGFUL EXPERIENCE', 2),
('R0602021', 6, 1, 10, 1201174046, 'It\'s better to be ostracized than to give up on hypocrisy because there is more power than our plan as humans, namely the power of God.', 3.62, 'I was very inspired by Soe Hok Gie, an Indonesian student activist. Life is a matter of courage, facing question marks, without us understanding without us being able to bargain. Accept and face it. There are only 2 choices, being apathetic or going with the flow. But I choose to be a human who knows his choices, knows his abilities, and wants to keep trying. Bismillah, I will be the next big things.', 2),
('R0602022', 6, 1, 10, 1201174051, 'Do The Best', 3.62, 'I want to study more about technology and sharing knowledge to each other', 2),
('R0602023', 6, 1, 10, 1201170119, 'Do your best', 3.61, 'sharing for caring', 2),
('R0602024', 6, 1, 10, 1201170396, 'live with a grateful heart', 3.34, 'I want to share my knowledge with the other', 2),
('R0602025', 6, 1, 10, 1201174320, 'Kalau Bisa Kenapa Tidak', 3.58, 'motivasi saya adalah dapat mendapat pengalaman, meningkatkan softskill,dan bisa bekerja sama dengan organisasi yang lebih terstruktur.', 2),
('R0602026', 6, 1, 10, 1201170332, 'Part-time Dreamer, Full-time Achiever', 3.8, 'I think Time is a very valuable thing, so this opportunity should not be wasted. Becoming an  Enterprise System Engineering Laboratory Assistant is part of my choice to carry out the points of  \"Tri Dharma Perguruan Tinggi\". I feel that there is my passion that will be greatly honed if I am become  Enterprise System Engineering Laboratory Assistant. I want to share my knowledge that i have learned. I will do my best as well as make maximum contribution and effort.', 2),
('R0702000', 7, 1, 10, 1201161135, 'Tidak ada orang yang sangat berbakat, tetapi adanya orang yang terus belajar dan bekerja keras.', 3.85, 'I want to be the person who have more value for myself. I need an organization experience especially in academic role. Expand my network because in life we need big network. Then, I want to make the laboratory better in a way do a research with the team and join in any competition with ENSYSE Laboratorium to make faculty better both with the ENSYSE Laboratorium Assistant or integration with the others laboratorium in School of Industrial Engineering (FRI).', 2),
('R0702001', 7, 1, 10, 1201164161, 'Harwork with Smartwork for Better Future', 3.05, 'Motivasi saya ingin menjadi asisten Laboratorium Ensyse dikarenakan saya memiliki minat lebih terhadap bahasa pemrograman yang terbilang cukup rumit namun hal tersebut dapat mengasah logika saya. Disanalah saya mulai tertarik untuk mempelajarinya khususnya sistem basis data, karena keingintahuan saya yang cukup besar terhadap sistem basis data memotivasi saya untuk belajar lebih dalam mengenai sistem basis data ini. Oleh karena itu dengan rasa keingintahuan dan motivasi belajar saya yang tinggi ', 2),
('R0702002', 7, 1, 10, 1201164431, 'THE MORE YOU GIVE, THE MORE YOU WILL GET ', 2.25, 'Motivasi saya dalam mengikuti lab ini, saya ingin mempelajari banyak hal mengenai Pemrograman dan Basis data. Karena, saya mempunyai bakat membuat website dan saya ingin mempelajari lebih , karena tidak semua pembelajaran saya bisa dapatkan pada saat kegiatan mengajar dikelas. Selain itu, saya ingin membagikan pengalaman dan pengetahuan yang saya miliki kepada praktikan yang sedang saya bimbing. Dan saya ingin memulai pengalaman baru saya dalam suatu laboratorium sebagai bekal saya nanti dalam d', 2),
('R0702003', 7, 1, 10, 1201164040, 'Dream It, Work for It, Achieve It. If I Fail, then I should TRY harder until SUCCEED.', 3.41, 'I want to Join Practicum Division in ENSYSE LAB, because I think I have a good skill at doing programming things using PHP and Bootstrap. I also learn how to use JQuery as well but not as good as PHP and Bootstrap. I also love the working environment in ENSYSE LAB, the people were fun enough so we can work in comfort. I have a motivation to improve the quality of ENSYSE LAB performance by providing better source code for available modules with my future team in Practicum Division. I also have an', 2),
('R0702004', 7, 1, 10, 1201164184, 'Do the best and pray. God will take care of the rest.', 2.95, 'I want to have a new experience that is different from what I usually do, I want to feel more confident to show my ability to people that I can also what people like to do. I want to meet new people and work with them if I am accepted as a laboratory assistant.', 2),
('R0702005', 7, 1, 10, 1201164197, 'Watch and Learn', 3.41, 'Berawal dari rasa ingin tahu saya yang sangat besar akan ilmu pengetahuan mengenai dunia pemrograman dan enterprise di dunia industri yang terus berkembang dengan kemajuan yang sangat pesat, saya ingin mengembangkan ilmu pengetahuan saya yakni didunia pemrograman dan desain sistem untuk dapat membuat sesuatu sistem yang terintegrasi sehingga membawa manfaat bagi semua orang.', 2),
('R0702006', 7, 1, 10, 1201164073, 'Keluarlah dari zona nyamanmu, melihat lah dunia lebih luas dan ciptakan lah zona-zona nyaman yang lain!', 3.19, 'Motivasi saya ingin menjadi asisten Laboratorium Enterprise System Engineering berasal dari keingin tahuan dan ketertarikan saya untuk mempelajari lebih dalam tentang hal- hal yang berhubungan dengan sistem informasi baik pemograman ataupun basis data. Oleh karena itu saya ingin ikut berpartisipasi dalam menjadi asisten Laboratorium Enterprise System Engineering karena apabila menjadi seorang asisten akan melatih soft skills dalam berbicara dan bertukar fikiran. Saya ingin mengembangkan hal-hal ', 2),
('R0702007', 7, 1, 10, 1201164269, 'selalu bertanggung jawab setiap harinya', 3.43, 'saya ingin menjadi bagian dalam keluarga lab ensyse dan ingin membawa lab ensyse menjadi lab yang tebraik di TI. tak terkecuali saya ingin mengembangkan ilmu yang sudah saya dapatkan dari matkul alpro dan basdat.', 2),
('R0702008', 7, 1, 10, 1201164341, 'Fall seven times and stand up eight.', 2.93, '1. Fear of failure.\r\n2. Do what you’re passionate for.\r\n3. Keep affirmations where you can see them.\r\n4. Leverage the power of rejection.\r\n5. Surround yourself with highly successful and motivated people.\r\n6. Never feel sorry yourself.\r\n7. Look for inspiration.\r\n8. Don’t obsess over your vision.\r\n9. Be grateful.\r\n10. Forget about motivation.', 2),
('R0702009', 7, 1, 10, 1201164013, 'setiap orang memiliki waktu untuk bersinar', 3.42, 'motivasi saya ingin menjadi bagian dari lab ensyse ini adalah saya ingin berkontribusi di bidang akademik  dan juga saya tertarik pada praktikum basis data yang sudah saya lewati kemarin', 2),
('R0702010', 7, 1, 10, 1201164378, 'Keep Moving Forward', 2.63, 'Saya senang melakukan pemecahan suatu masalah, seperti troubleshooting pada web, dan juga saya ingin memanfaatkan skill saya dalam bidang teknologi. ', 2),
