('R1102007', 11, 2, 13, 1202160185, 'Semua tujuan akan tercapai bila ada komitmen didalam proses nya', 3.32, '1. Agar menjadi orang yang bermanfaat bagi orang lain, saya berharap dapat membantu praktikan dengan ilmu yang saya miliki\r\n2. Membuat keluarga bangga dan memberikan persembahan yang terbaik bagi kedua orang tua\r\n3. Menambah relasi menjadi salah satu motivasi saya. Dengan relasi saya harap dapat mempunyai hubungan yang dapat berguna untuk kedepan nya', 2),
('R1102008', 11, 2, 13, 1202164072, 'Hidup hanya sekali. Jangan buang-buang waktu. Jangan sia-siakan kesempatan. ', 3, 'Saya suka mengajar, saya suka bersoasialisasi, saya suka ngulik. Saya orang yang sangat penasaran.  Saya tidak ingin menyia-nyiakan kesempatan yang ada karena saya tau kesempatan ini tidak akan datang untuk kedua kalinya. Saya ingin ketika saya lulus nanti, ada hal yang berkesan dalam perjalanan kuliah saya, saya ingin ketika saya lulus nanti ada hal yang bisa saya ingat sebagai hal yang pernah saya kerjakan yang pasti bisa menambah semangat lagi untuk saya.  saya ingin waktu saya terpakai untuk', 2),
('R1102009', 11, 2, 13, 1202160202, 'do the best god takes the rest', 3.46, '1. Saya ingin berkontribusi kepada jurusan dan universitas\r\n2. Saya ingin membagikan ilmu saya, ilmu yang bermanfaat adalah amal jariyah\r\n3. Saya ingin berada dilingkungan orang - orang yang hebat dalam bidangnya\r\n4. Saya ingin mengasah ilmu saya', 2),
