('R1102013', 11, 2, 13, 1202164224, 'dream big, set goals, take action', 3.55, 'ingin membagikan ilmu yang saya miliki dan tentunya ingin menambah ilmu bersama orang-orang yang memiliki kesamaan dalam hal yang disuka', 2),
('R1102014', 11, 2, 13, 1202160372, 'Be a warrior, not a worrier', 3.82, 'Saya menyukai bidang pemrograman sejak saya semester 3. Dan menurut saya, pada era teknologi ini, aplikasi web sangat dibutuhkan untuk memudahkan pekerjaan manusia. Oleh karena itu, saya ingin mengimplmentasikan ilmu yang saya punya agar banyak praktikan nanti yang dapat membuat aplikasi web sesuai dengan kreativitas yang mereka miliki.', 2),
('R1102015', 11, 2, 13, 1202160253, 'dont stop when youre tired, stop when you are done', 3.8, 'Saya tertarik dengan bidang programming terutama dalam website programming dimana dunia web sangat dibutuhkan pada zaman sekarang. maka dari itu saya ingin berbagi ilmu tentang web agar setidaknya banyak yang mengerti tentang dasar dari dunia programming.', 2),
