('R1402009', 14, 2, 15, 1202160111, 'you are stronger than you think', 3.7, 'Saya percaya bahwa saya adalah seseorang yang pekerja keras, berani untuk mempelajari hal baru sekaligus menekuninya, dan terbuka akan setiap arahan dan nasihat yang membangun dalam hal positif, dan senang untuk membantu dan membuat diri saya lebih bermanfaat dilingkungan saya. Dengan moto hidup saya “ YOU ARE STRONGER THAN YOU THINK” saya pikir tidak ada pembatas dalam  kreativitas dan keinginan saya kalau bukan diri saya sendiri, dan saya membuka peluang saya dan kesempatan saya disini dengan ', 2),
