('R1702003', 17, 2, 14, 1202160048, 'Everything happen by a reason so don\'t everything too fast', 3.73, 'I want to learn and implement all the knowledge about Enterprise Architect that I have been studied. I hope I can to improve my skill in teaching and analysis.', 2),
('R1702004', 17, 2, 14, 1202164123, 'Jangan takut untuk jatuh dan bangkit lagi', 3.36, 'Menjadi asisten prakrikum EA adalah satu langkah lebih dekat mencapai cita cita saya menjadi enterprise architect di masa depan', 2),
('R1702005', 17, 2, 14, 1202164143, 'Prioritaskan yang harus diprioritaskan', 3.65, 'I want to teach people and share my knowledge with people and can be useful for people.  I also want to learn more about the knowledge that I can get at BPAD', 2),
('R1702006', 17, 2, 14, 1202160353, 'One Step Forward', 3.62, 'Menjadi seorang kakak dan pengajar, Mampu berkomunikasi dengan baik, Berorganisasi dengan baik.', 2),
('R1702007', 17, 2, 14, 1202164113, '\"Semua kemajuan tewujud di luar zona nyaman\"', 3.74, 'Karena saya asisten laboratorium BPAD (Business Process Analysis and Design) angkatan 2016. Saya lolos tes peminatan matakuliah EA (Enterprise Architecture) sehingga saya sudah mengambil kelompok matakuliah peminatan EA dari semester 5 lalu. Saya juga mendapatkan nilai A pada matakuliah EA di semester 5. Saya senang mengajar dan pada semester ini menjadi asprak RPB dan APSI. Sehingga saya ingin menjadi asprak EA di semester depan.', 2),
('R1702008', 17, 2, 14, 1202160292, 'If your live gives a lemon just pour a vodka', 3.61, 'make my family happy, especially my mother who had aspired to her child (me) to become a teacher. By being part of the BPAD assistant I will learn to be a teacher for my younger siblings and share the knowledge that I have learned. I hope that by becoming a BPAD assistant at least I can realize my mother\'s little dream.', 2),
('R1702009', 17, 2, 14, 1202164131, 'Doing as much as you can for as long as you can', 3.59, 'Tidak ingin menjadi mahasiswa biasa', 2),
('R1702010', 17, 2, 14, 1202160258, 'Sukses dunia dan akhirat.', 3.72, 'Menurut saya, menjadi bagian dari BPAD Laboratory adalah wadah yang tepat untuk saya belajar dan berkembang. Saya yang awalnya tidak memiliki dasar dalam memodelkan suatu bisnis, bahkan saya baru mengenal bagaimana memodelkan proses bisnis dan menganalisisnya. Ketika saya diajarkan oleh dosen, teman-teman dan asisten praktik, saya merasa bahwa mencoba hal yang baru itu perlu. Saya juga senang berbagi. Ketika saya mendapatkan lebih banyak ilmu dari mengikuti BPAD Lab maka saya dengan senang hati ', 2),
('R1702011', 17, 2, 14, 1202164203, 'when i do what i love, i believe that isn\'t work anymore', 3.65, 'i want share my knowledge to other people', 2),
('R1702012', 17, 2, 14, 1202160105, 'useful life by sharing to others', 3.8, 'My motivation to be an EA assistant is that I want to share the knowledge that I have so that the usefulness of my knowledge will be as broad as the ocean and by being an EA assistant I expect to plunge deeper into.', 2),
('R1702013', 17, 2, 14, 1202160107, 'new things are challenges that must be faced for better quality', 3.03, 'This interest is based on the field that I am currently engaged in my Collegues at this time precisely in major of information systems. I know, as a student of information systems, I have a focus on how to manage and capture data to produce a useful information with the help of information technology. I am sure that I am a person who can be responsible and act seriously to contribute to BPAD Laboraotry as an Assistant. If I can be accepted as an Assistant, this will be my experience that I will ', 2),
('R1702014', 17, 2, 14, 1202164241, 'Nothing Tulus', 3.68, 'Ingin berbagi.', 2),
('R1802000', 18, 2, 11, 1202171049, 'Do my best what should i do', 3.93, 'Hopefuly, i will get more knowledge in Daspro laboratory especially in Data Structure. Coding and alghoritms are two things that i interest. For me, solve many problems with code is very fun and dare. I hope, joining this lab and its practicum can improving my skills. Both hard and soft skill .', 2),
('R1802002', 18, 2, 11, 1202174008, 'Jangan mudah menyerah, ingat kita merupakan mahluk sosial yang saling membantu', 3.76, 'ingin mengembangkan minat di bidang koding dan ingin memperluas relasi', 2);
INSERT INTO `oprec_general` (`id_oprec_gen`, `id_oprec`, `id_major`, `id_lab`, `nim`, `motto`, `gpa`, `motivation`, `oprec_status`) VALUES
('R1802003', 18, 2, 11, 1202174143, 'Don\'t compare yourself with anyone else', 3.7, 'Saya sejak kecil menyukai sesuatu hal yang berhubungan dengan angka dan logika, juga dengan komputer dan teknologi lainnya. programming adalah salah satu irisan dari kesukaan saya, di sistem informasi ini saya ingin mengembangkan potensi saya dalam mengajar pada bidang programming yang salah satunya adalah menjadi asisten praktikum struktur data yang sebelumnya saya sudah pernah menjadi asisten praktikum algoritma dan pemrograman dibawah laboratorium daspro dan menjadi salah satu asisten dosen m', 2),
('R1802004', 18, 2, 11, 1202160197, 'knowledge means to be shared', 3.38, 'Saya ingin membagikan ilmu yang sudah pernah saya dapatkan karena itu akan membuat proses pembelajaran saya menjadi komplit. Karena menurut saya siklus belajar itu adalah mencoba, mendapat ilmu, lalu membagikannya. Saya juga ingin berjasa bagi negara saya dengan ikut serta membimbing para generasi generasi yang nantinya akan menjadi kaki bagi negara melangkah ke masa depan. Saya yakin ilmu struktur data akan sangat berguna untuk negara ke depannya.', 2),
('R1802005', 18, 2, 11, 1202174288, 'Hold commitment by responsibilities i have taken.', 3.35, 'Achieving some responsibilities in my life, means I should face every risk would happen, I should take every chance that  would happen. Choose Daspro and join the selection to be Assistant for Structure Data would be my jumping stone to reach my planning for my future, it would be related to my dream job later as Data Scientist. I\'d hope, when I being part of Daspro Laboratory, it will be my best environment to improve my self. Whatever the risk later, I believe I can face it. ', 2),
('R1802006', 18, 2, 11, 1202172024, 'Perpetual optimism is a force multiplier', 3.48, 'Because i think i\'m qualified enough to fulfill this position, and i am ready to give my best to get this position', 2),
('R1802007', 18, 2, 11, 1202170118, 'Always do your best in whatever you do', 3.85, 'tertarik dengan programming, ingin mendapatkan pengalaman sekaligus pembelajaran dan terakhir ingin membuat orang terdekat bangga', 2),
('R1802008', 18, 2, 11, 1202174137, 'Hidup Damai dan Sejahtera', 3.8, 'Kalau kita tidak mencoba, kita tidak bakalan tahu apa yang terjadi', 2),
('R1802009', 18, 2, 11, 1202174082, 'Just do your best, Allah knows best', 3.88, 'Motivasi saya mengikuti rekrutasi ini adalah melanjutkan tanggung jawab yang sudah diberikan setelah diterima menjadi asisten Daspro, dan juga sebagai bentuk kontribusi saya terhadap jurusan dan menyalurkan minat saya serta apa yang saya ketahui kepada para penerus SI', 2),
('R1802010', 18, 2, 11, 1202174321, 'life, out of the comfort zone', 3.85, 'Alasan saya mengikuti rekruitasi asisten praktikum struktur data ini karena saya ingin menambah pengalaman lebih banyak, dengan melanjutkan mendaftar menjadi asisten praktikum struktur data. saya ingin ilmu-ilmu yang saya dapatkan, dapat berguna juga bagi orang lain. selain itu, ini merupakan salah satu bentuk kontribusi saya terhadap jurusan, dengan melanjutkan tugas sebagai asisten praktikum struktur data dan mengajari adik-adik yang akan menjadi penerus kami.', 2),
('R1802011', 18, 2, 11, 1202174326, 'Maju terus', 3.95, 'Saya ingin menjadi orang yang terus berkembang menjadi lebih baik dari diri saya yang sebelumnya.', 2),
('R1802012', 18, 2, 11, 1202174068, 'Always Grateful', 3.79, 'Saya ingin berbagi ilmu dengan mengajar sebagai Asisten Praktikum Stuktur Data. Yang mana dengan saya menjadi asisten praktikum saya dapat berkontribusi dengan fakultas dan jurusan, serta saya ingin mengembangkan lagi ilmu mengajar saya yang sebelumnya saya lakukan di praktikum alpro.', 2),
