('R1802017', 18, 2, 11, 1202170365, 'Melakukan semua hal dengan hati yang baik, dan tidak mengharapkan apapun sehingga tidak akan kecewa.', 3.27, 'Ketidak mampuan akan suatu hal bukan suatu halangan untuk melakukan hal yang lebih besar lainnya.', 2),
