('R2401041', 24, 1, 8, 1201183347, 'Takdir yang telah diperjuangkan, apapun hasilnya itu yang terbaik', 3.81, 'Ini pertama kali saya daftar untuk menjadi asisten di fakultas rekayasa industri, saya ingin belajar, mendalami tentang ergonomi, dan berbagi apa yang saya ketahui. Saya tertarik ingin menjadi asisten di laboratorium APK&E karena saya rasa ilmu yang akan didapatkan akan sangan bermanfaat untuk masa depan, karena saya rasa, di Indonesia masih belum menerapkan ilmu ini.', 2),
('R2401042', 24, 1, 8, 1201180362, 'We can\'t be perfect. But we can be the best version of ourself.', 3.78, 'There are so many thing that i still wanna about this \"Big Things\". And of course this is a once in a lifetime so i should be a part of this \"Big Things\".', 2),
