('R2401053', 24, 1, 8, 1201184280, 'Suatu hal kecil bisa merubah masa yang akan datang, maka dari itu jangan sia-siakan hidup kamu dan lakukan banyak hal-hal yang bermanfaat untuk lingkungan dan hidup kamu sendiri', 2.83, 'selama ini saya masih belum banyak melakukan hal besar dalam hidup saya. Dan sekarang saya ingin memulai dengan langkah kecil, memanfaatkan waktu kuliah saya dengan hal-hal bermanfaat dan pastinya akan berguna untuk masa depan. Saya saat ini memulai dari hal kecil yaitu ingin mencoba menjadi seorang asisten lab yang pastinya tidak mudah. Dengan menjadi asisten lab pastinya banyak hal bermanfaat yang akan saya dapatkan dan pastinya bermanfaat pada masa yang akan datang', 2),
('R2401054', 24, 1, 8, 1201184379, 'Dream Create Inspire !', 2.95, 'Berperan dalam suatu laboratorium adalah salah satu keinginan saya sejak awal masuk telkom university. Laboratorium APK & E merupakan lab yang paling saya minati karena saya ingin sekali mendalami ilmu analisis dan perancangan kerja. bagi saya ini adalah lab yang paling menarik karena saya dapat mempelajari Ergonomi yang dapat saya terapkan untuk kehidupan sehari-hari dan mungkin akan menjadi manfaat yang sangat mahal nantinya', 2),
('R2401055', 24, 1, 8, 1201180225, 'Ikhtiar dan berdoa ', 3.7, 'Life is too short, so just give it a shot! \r\nPenyesalan datang nya belakangan, kalau duluan namanya pendaftaran :)', 2),
