('R2501007', 25, 2, 14, 1202174048, 'prejudice both with God, because every human being has been given their respective fortune each', 3.7, ' many other friends feel that analyzing a problem in a company and providing solutions so that a problem can be solved and making the company as it aims is difficult, but I want to give the understanding that analyzing is not a difficult thing if we already know the basics, because actually in analyzing there is nothing wrong but which is the best. ', 2),
('R2501008', 25, 2, 14, 1202174125, 'Target, Requirment, Priorty', 3.35, 'I have a commitment where I invite all my friends Assistant BPAD can together create a positive environment together with the real steps that are learning together, understanding together, and implementation together with friends, so that every Assistant who will join the Lab. This BPAD can have a shared sense of responsibility to build the same positive and shared environment to achieve the same goals.', 2),
('R2501009', 25, 2, 14, 1202174157, 'There is no right time to do something, so do it now before its late. ', 3.37, 'My motivation to be a Practicum Assistant are because for me being an Assistant is something new in my life and challenging, so that makes me want to learn and sharpen my skills to be better. When i was in the first semester i saw a Practicum Assistant when their teach people and i was like, “wow! This one is very cool. I hope someday i can be an Assistant too”. Since that day i determined myself to be a Practicum Assistant. Another reason why i want to be a Practicum Assistant is because BPAD L', 2),
