('R2501015', 25, 2, 14, 1202174235, 'Striving to become a better person and always be the best', 3.77, 'During my courses , I discovered many new things. At first I had the feeling that I was in a wrong direction, because I was a high school graduate. Unlike some of my other friends, they already have their own basic in this department because they were graduated from the Vocational School. Because my interest is in doing businesses, I finally tried to look after the departments that study businesses. Finally I found an Information Systems major which I felt was compatible with the things I wanted', 2),
