('R2601032', 26, 2, 14, 1202174146, 'Bercita-citalah setinggi mungkin! Kamu bisa kok jadi apa yang kamu mau. Kata siapa cita cita harus sesuai kemampuan ? Kalo kamu mematok cita-citamu sesuai kemampuan kamu yang saat ini masih terbatas, kapan kemampuan kamu berubah melampaui batas?', 3.75, 'Saya ingin berbagi ilmu dengan mengajar sebagai Asisten APSI. Yang mana dengan saya menjadi asisten praktikum saya dapat berkontribusi dengan fakultas dan jurusan, serta saya ingin bermanfaat bagi orang lain', 0),
