('R3301012', 33, 1, 9, 1201174134, 'kita terlalu kecil untuk raksasa diatas sana', 2.75, 'Motivasi saya mendaftar sebagai asisten lab PDEV yaitu, ini merupakan kesempatan yang tentunya tidak datang dua kali. Saya fikir, menjadi asisten lab tidak hanya mendapatkan ilmu dan wawasan baru, tetapi juga bisa membagikan ilmu yang udah kita dapat ke adek tingkat yang akan datang. Daftar nya saya menjadi asisten lab juga menjadi challenge buat diri saya yaitu agar saya bisa memanage waktu dan mengetahui hal-hal baru.', 2),
('R3301013', 33, 1, 9, 1201174380, 'Nobody fails', 2.97, 'Make parents happy, be proud of my self, and have a high curiosity', 2),
('R3301014', 33, 1, 9, 1201174403, 'suka gasuka tetep harus dijalanin', 2.07, 'because every time I got PDev practicum I was happy and had no objections, and from the start I was interested in becoming a PDev lab asistant', 2),
('R3301015', 33, 1, 9, 1201174343, 'Everyday is a chance to learn something new', 3.04, 'To know the specific knowledge about Product Development, to improve the soft skills and to make the time more useful.', 2),
('R3301016', 33, 1, 9, 1201174090, 'Lakukan semua hal yang kamu inginkan sampai menemukan yang terbaik', 2.58, 'Saya ingin memperdalam ilmu tentang segala pengembangan produk karena menurut saya hal ini akan sangat berguna di masa yang akan datang dimana kreatifitas akan di uji , dan ingin membagikan ilmu yang saya dapatkan dari lab ini', 2),
('R3301017', 33, 1, 9, 1201174251, 'Jangan takut gagal karena semua sudah ada rezekinya masing masing', 2.67, '1. Pdev adalah salah satu lab yang paling saya suka selama semester 5\r\n2. Ingin menambah pengalaman menjadi asisten\r\n3. Ingin membantu praktikan dalam memahami proses proses atau materi pengembangan produk\r\n4. Ingin belajar bagaimana cara mengajar dan membimbing dengan baik dan benar\r\n5. Menambah ilmu tentang pengembangan produk', 2),
('R3301018', 33, 1, 9, 1201170050, 'Everything shall pass at the end, it\'s you who decide doing it right or not', 3.4, 'Being beneficial for everyone around me in every steps I take&having a good time management', 2),
('R3301019', 33, 1, 9, 1201174164, 'opportunity agreed, but must be created', 2.96, 'i want to find experience in an activity that I will follow then i want to get a lot of knowledge and also can share knowledge', 2),
('R3301020', 33, 1, 9, 1201174089, 'jangan pernah diam di zona nyaman', 2.23, 'life must go on', 2),
('R3301021', 33, 1, 9, 1201174382, 'You are destined to be succeed', 2.58, 'To be honest, I want to make my parents proud of me, want to learn something new with a new way and new environment, challenging my self to be more discipline, next I want to prove my ability and increase my knowledge. Last I want to be someone who can share knowledge to each other. it is  important for being a usefull person', 2),
('R3401001', 34, 1, 7, 1201174293, 'Nobody can take away your pain. so, dont let anyone to take away your happiness', 3.4, 'I want to develop myself in this laboratory and also give my best for this laboratory', 2),
('R3401002', 34, 1, 7, 1201174371, 'BE BETTER', 3.17, 'improve my experience and want to develop skills in the field of Business simulation', 2),
('R3401003', 34, 1, 7, 1201174376, 'Efficiency and effectivity are must, cause I don\'t wanna waste my time and energy just become useless. At least, I have to be happy.', 3.36, 'First, I wanna learn to be an assistant laboratory by doing research and practicum for my CV and also to add an experience that supports my goal in SCM Professionalism. Second, sure I want to share my experience with my junior later about this laboratory. Last, I wish that I can be the assistant who gives achievement to this laboratory.', 2),
('R3401004', 34, 1, 7, 1201174108, 'Enjoy your life and be grateful', 3.64, 'I am interest doing some research and cover more about business simulation software. I really want to solve problem that occur in social life with business simulation knowledge. I also want to help my friends and junior understand about business simulation.', 2),
('R3401005', 34, 1, 7, 1201170118, 'Do the best and Allah take the rest.', 3.66, 'I motivate to make simbi laboratory to be better and also to help other students to achieve something good from SIMBI Laboratory', 2),
('R3401006', 34, 1, 7, 1201174192, 'The Slightest Opportunity, Pick Up, Not Just Wait ', 3.5, 'From this experience, I can understand more in a field of industrial engineering that is about creating simulation models of real systems through special studies, in addition to academic, organizational experience is also gained.', 2),
('R3401007', 34, 1, 7, 1201174073, 'Don\'t be afraid to be yourself!', 3.38, 'my motivation to join is to gain extra-ordinary experiences with extra-ordinary people', 2),
('R3401008', 34, 1, 7, 1201174273, 'Manjadda Wa Jada', 3.37, 'Adding knowladge and experience in the field of simulation and business which in my opinion will be usefull when graduating or in the real world of work later and also to apply the knowladge that has been previously taught with the form of simulation so that it will better understand about the science because in the business simulation laboratory we do not work alone but with other great people who have the same vision and mission so that the goals set at the beginning will be easily achieved an', 2),
('R3401009', 34, 1, 7, 1201170381, 'Don\'t be afraid to be yourself!', 2.4, 'My motivation to dare enrol in this business simulation laboratory is to prove that I can and do not always have to be underestimated in front of my friends.', 2),
('R3401010', 34, 1, 7, 1201174280, 'Spread Kindness Everywhere', 3.32, 'To be the best of who i am', 2),
('R3401011', 34, 1, 7, 1201174222, 'hidup seperti larry', 2.3, 'mejadikan diri lebih bermanfaat bagi orang yang membutuhkan', 2),
('R3401012', 34, 1, 7, 1201174153, 'kejarlah, karena menunggu hanya menghabiskan waktu', 2.77, 'saya ingin memperdalam ilmu simulasi bisnis dalam dunia industri', 2),
('R3401013', 34, 1, 7, 1201173445, 'Be a blessing', 3.22, 'motivasi saya mendaftar ke lab ini untuk memperdalam ilmu-ilmu tentang business simulation dalam berbisnis', 2),
('R3401014', 34, 1, 7, 1201170264, 'bermimpi setinggi mungkin, jangan berjalan didalamnya', 2, 'Nama saya Yanna Savitri dari TI-41-11. Saya memiliki sifat baik, ramah, ingin tahu terhadap sesuatu khususnya yang berkaitan dengan bisnis. Bagi saya dunia bisnis merupakan sesuatu hal yang ingin terus saya gali ilmunya. Dalam dunia bisnis sekecil apapun kontribusi kita akan menghasilkan benefit. Laboratorium simulasi bisnis merupakan laboratorium dengan prestasi yang sudah tidak diragukan lagi. Mulai dari kegiatan research group maupun asistennya. \r\n	Dalam dunia perkuliahaan bakat dan kegemaran', 2),
('R3401015', 34, 1, 7, 1201170035, 'Live like you will die tomorrow', 3.25, 'Always take the chance in your life to develop yourself. Being an assistant is a big opportunity to make myself better at everything, starting with time management, being able to work well together, and learn how to work with commitment, integrity, and dedication.', 2),
('R3401016', 34, 1, 7, 1201174078, 'Work, Pray, and Believe.', 3.58, 'I want to learn new things and out of my comfort zone.', 2),
('R3401017', 34, 1, 7, 1201170351, 'When you feel like quitting, think about why you started', 2.99, 'Want to explore more about industrial engineering especially in business simulation', 2),
('R3401018', 34, 1, 7, 1201174100, '“Work Hard in silence, let success be your noise. Stay humble and keep be nice to people.”', 2, 'Being good Simbi Assistant, and be competent on that.', 2),
('R3401019', 34, 1, 7, 1201174324, 'Do good and good will come to you', 3.43, 'To be more valuable to everyone and gain more experience', 2),
('R3401020', 34, 1, 7, 1201170029, 'learn from all mistake', 2.41, 'Being assistant', 2),
('R3401021', 34, 1, 7, 1201170231, 'trust the timing of your life', 2.66, 'Saya ingin menyatakan ketertarikan saya untuk bergabung sebagai asisten laboratorium di Lab simulasi bisnis Telkom University', 2),
('R3401022', 34, 1, 7, 1201170219, 'jangan menyiakan nyiakan hidupmu', 2.22, 'mendalami ilmu simulasi di simbi dan mencari pengalaman', 2),
('R3401023', 34, 1, 7, 1201172373, 'just be kind, always', 2.98, 'ingin memanfaatkan waktu luang dengan kegiatan yang bermanfaat bagi orang lain dan diri sendiri', 2),
('R3401024', 34, 1, 7, 1201170301, 'Kalo kata bapakku sih, kalo kamu ingin dihargain oleh orang lain, maka kamu harus menghargain orang lain terlebih dahulu dan jangan lupa untuk intropeksi diri', 3.48, 'Motivasi saya masuk ke laboratorium simbi yaitu saya ingin mencari hal-hal baru seperti yang berhubungan dengan sesuatu dibidang akademik, bisa juga untuk menambah koneksi atau relasi di laboratorium simbi ataupun dosen juga dan yang paling seru sih bisa dapet uang sendiri dengan hasil kerja sendiri.', 2),
('R3401025', 34, 1, 7, 1201174236, 'Do Good, Be Kind.', 3.49, 'I want to enhance my skill and be the best among the best. I also want to challange myself to try something new and be the next big things.', 2),
('R3401026', 34, 1, 7, 1201160195, 'Mawapres adalah cita cita saya', 3.59, 'Simbi idolaku', 2),
('R3401027', 34, 1, 7, 1201174150, 'Jadilah seperti bunga yg memberikan keharuman bahkan kepada tangan yg telah merusaknya. ', 3.54, 'saya ingin mengembangkan diri saya dan juga ingin berkontribusi dan mengabdi kepada telkom dan fakultas rekayasa industri dengan mendaftarkan diri saya untuk menjadi asisten laboratorium simulasi bisnis', 2),
('R3401028', 34, 1, 7, 1201170199, 'Do the best', 3.14, 'Untuk mencari pengalaman organisasi dan meningkatkan kemampuan yang dimiliki', 2),
('R3401029', 34, 1, 7, 1201174355, 'semangat terus', 2.89, 'Menjadi orang yang berguna dan mempelajari program simulasi lebih dalam', 2),
('R3501001', 35, 1, 6, 1201170297, 'blabla', 3.5, 'sukses', 2),
('R3501002', 35, 1, 6, 1201184147, ' The dream is indeed beautiful, but wake up and make that dream come true.', 2.42, 'Your future is determined by what you start today.', 2),
('R3501003', 35, 1, 6, 1201180141, 'No matter what people say, I will always do my best.', 3.88, 'My motivation for being the next big things is no matter what people say, no matter what people underestimate us. life is what we decide. show them that we can and we are better than them, and we can be more successful than them.', 2),
('R3501004', 35, 1, 6, 1201180134, 'I believe in my self. I can do everything in this world', 3.46, 'I want to be one of these big things. I want to learn more about APK& E. I want to share my knowledge with people. I want to make a friend, more friends. I want to study more about APK&E and be one of them.', 2),
('R3501005', 35, 1, 6, 1201184069, 'Butktikan bahwa ketika kamu mencoba dan berusaha keinginanmu akan terwujud', 3.5, 'Saya ingin memberikan yang terbaik dan membuat orang lain terkesan atas apa yang saya lakukan dan menjadikan laboratorium ini menjadi yanng terbaik. ', 2),
('R3501006', 35, 1, 6, 1201184317, 'Selalu awali apapun dengan Bismillah.', 3.81, 'Karena mengikuti PAP, saya jadi tau apa yang menjadi minat dan passion saya di TI Telkom. Bidang manufaktur merupakan cita-cita orang tua saya dan saya ingin membahagiakan mereka. Tidak semata-mata membahagiakan saja, tapi karena sesuai minat dan passion. Menjadi Asisten Lab merupakan salah satu cara mewujudkan passion saya.', 2),
('R3501007', 35, 1, 6, 1201184039, 'choose to be happy', 3.56, 'I want to make people around me happy', 2),
('R3501008', 35, 1, 6, 1201184353, 'Bersyukur', 2.2, 'I want to up my knowledge and skill in the manufacturing process. and I want to share my knowledge with the practican.', 2),
('R3501009', 35, 1, 6, 1201180407, 'rest when you finish something, not when you tired,', 2.47, 'my motivation is always do the best wherever you are. and must learn everyday about something new bcs everyday is a new day, keep moving and keep progressing for your goal. and dont forget to pray ', 2),
('R3501010', 35, 1, 6, 1201182474, 'Do your best and let God do the rest', 3.48, 'My main motivation for applying this position is to learn more about manufacturing process, especially in machining tools and equipment. My other motivation are to add more relation by knowing each other and improve the Manufacturing Process Laboratory. ', 2),
('R3501011', 35, 1, 6, 1201184320, 'First you have to learn, then you remove the ', 3.76, 'This is the first time I apply for an assistant in Industrial Engineering, especially in Manufacturing Process Laboratory. I want to learn something that I haven\'t learned before and I am really curious about things related to machining, processing, etc. Besides that, I want to increase my experiences in this chance for my future needs. So, I really interested in this Laboratory for being an assistant.', 2),
('R3501012', 35, 1, 6, 1201184026, 'There\'s always a good thing in everything, just be positive, do your best and trust Allah.', 4, 'I want to become an useful human being and a competent engineer.', 2),
('R3501013', 35, 1, 6, 1201180386, 'You only live once, therefore do your best in life, and leave the rest to god', 3.09, 'From the start I choose Industrial Enigeering because I think its my passion and I like it. And when I do Prosman Practicum I like it because I think Prosman is very industrial engineering. So I want to learn more about it, be a part of it, and share my knowledge.  ', 2),
('R3501014', 35, 1, 6, 1201184177, 'nothing impossible. keep trying then praying and leave the rest to the God', 3.56, 'college life is not just studying and going home. we have to be active. and then I see my passion at Manufacuring process laboratory after 1 semester of learning at this lab. From the beginning of this semester, I like Prosman more than the other lab. and because of it, I want to be the part of Prosman team. and we also have to look at the future, this knowledge about manufacturing is very important at industrial engineering and definitely used at the working world. I want to study more and more', 2),
('R3501015', 35, 1, 6, 1201184288, 'Santai tapi tercapai', 3.47, 'Saya ingin mendalami proses manufaktur dalam sebuah industri. Saya rasa ini seperti panggilan hati dan passion saya. Saya ingin mengikuti passion saya. Sebaik-baiknya pekerjaan adalah bekerja dengan passion. ', 2),
('R3501016', 35, 1, 6, 1201184324, 'do the things that makes you awesome', 3.43, 'I am very interested in the machines in prosman laboratory, and I really want to be able to operate it professionally', 2),
('R3501017', 35, 1, 6, 1201180292, 'selama kita yakin semua bisa terwujud', 2.89, 'To be more productive and focused', 2),
('R3501018', 35, 1, 6, 1201184293, 'The problem is not to be dealt with harshly,  but to be addressed patiently', 3.36, 'Let me introduction my self before , I am Ananda Julian Nugraha from TI-42-01.\r\nMy motivation is if I become a PRO, I want to be deeper into my knowledge and look for new experiences that will certainly be very useful in the future. Because I have followed PAP who is a research group with some special skills on there. It makes me push to explore more than a research group. My intention is to add knowledge and relation. for sure make easier my last assigntment and make a reference for my junior', 2),
('R3501019', 35, 1, 6, 1201184279, 'to make productive life, so as to enhance a better personality', 3.43, 'beside i want to get experience, i want to get relation with other people so i can get knowledge from them. i will share my knowledge for the others, i want to enhance my skill, i want to make productive life, and then i want to be a useful person. ', 2),
('R3501020', 35, 1, 6, 1201180323, 'Life is a one way TICKET', 3.21, 'Because there is no second chance,so better i try my best,so i dont regret the other day', 2),
('R3501021', 35, 1, 6, 1201182475, 'do everthing you think that\'s interesting to learn', 3.54, 'i want to know more deeply and i will give my best. ', 2),
('R3501022', 35, 1, 6, 1201180444, 'Hidup Mulia Mati Masuk Surga!!:)', 2.75, 'Saya ingin menambah wawasan dan pengalaman baru.\r\nIngin belajar hal ttg apapun di lab ini.\r\nIngin menambah teman lebih banyak\r\nSuka dengan tantangan\r\nIngin mengasah skill yg ada dan yg belum terlihat.', 2),
('R3501023', 35, 1, 6, 1201184032, 'Experience is the best teacher', 3.69, 'Saya ingin memperbanyak ilmu serta pengalaman saya baik dari yang saya alami sendiri maupun dari bertanya pengalaman dan ilmu orang lain agar nantinya saya siap menghadapi dan terjun langsung ke dunia masyarakat dan dunia kerja nantinya', 2),
('R3501024', 35, 1, 6, 1201180201, 'do the best and allah will do the rest', 4, 'keep trying and never give up, do your best. Do not easily sitisfied with the result that have been obtained, and always be kind to others.', 2),
('R3501025', 35, 1, 6, 1201180245, 'Hadapi, Hayati, Nikmati', 3.65, 'Ingin meringankan beban keluarga.', 2),
('R3501026', 35, 1, 6, 1201184284, 'Tidak akan tahu jika tidak berani', 3.55, 'if i become an assistant, ill study alot and harder, so i can share all the knowledge that i have been learning before to everyone.', 2),
('R3501027', 35, 1, 6, 1201184437, 'Life is never flat', 3, 'First, i love everything that smells of machinery. Second, i want to improve my manufacturing knowledge. Third, i want to be a big part of Telkom University Manufacturing Process Laboratory', 2),
('R3501028', 35, 1, 6, 1201180129, 'Where there’s a will, there’s a way', 2.98, 'My motivation to become a PROSMAN lab assistant is because I am very interested in this lab and I want to have more knowledge about manufacturing besides that I also want to fill my free time to be more useful\r\n', 2),
('R3501029', 35, 1, 6, 1201184374, 'Berpegang teguhlah kepada mimpi agar senantiasa belajar dan meraihnya', 3.06, 'Ingin menambah wawasan agar kemampuan yang ada semakin bertambah serta memperbanyak relasi untuk meningkatkan kemampuan komunikasi ', 2),
('R3501030', 35, 1, 6, 1201180031, 'finish what you\'ve started', 2.4, 'if someone entrusts a position in an organization and others, do not disappoint and most importantly be yourself', 2),
('R3501031', 35, 1, 6, 1201182410, 'Never back, always forward!', 2.9, 'Saya ingin melatih dan menambah skill di bidang proses manufaktur, ingin mengetahui apa yang belum saya ketahui secara mendalam tentang proses manufaktur, menambah relasi, saya ingin menjadi orang yang bermanfaat bagi diri sendiri maupun orang lain, ingin berbagi ilmu yang saya ketahui kepada teman-teman, serta ingin melatih mental saya agar lebih sigap dalam menghadapi suatu masalah.', 2),
('R3501032', 35, 1, 6, 1201180393, 'Always be kind to everyone', 3, 'In this semester, from the beginning of the practicum and the lecture strated, I am very curios and want to learn more new things about the manufacturing process,   one way to learn more about the menufacturing process is to become one of the laboratorium assistant.', 2),
('R3501033', 35, 1, 6, 1201181375, 'Usaha tidak sama dengan 0 ( Nol )', 2.99, 'Ingin bermanfaat dan berbagi ilmu dan mencari pengalaman ', 2),
('R3501034', 35, 1, 6, 1201182464, 'Change your mind and you can change your world.', 2, 'Do Your Best and Prove it.', 2),
('R3501035', 35, 1, 6, 1201180163, 'one step forward', 3.33, 'I want to help those in needed', 2),
('R3501036', 35, 1, 6, 1201184329, 'No Mistakes', 3.66, 'Born to be something', 2),
('R3501037', 35, 1, 6, 1201184411, '-', 0, '-', 2),
('R3501038', 35, 1, 6, 1201184107, 'Hidup itu menghidupi', 3.4, 'Saya ingin bermanfaat dengan manusia yang lain salah satunya dengan memanfaatkan potensi yang dimiliki dan disalurkan di lab prosman selain itu saya ingin memanfaatkan fasilitas yang ada di lab', 2),
('R3501039', 35, 1, 6, 1201180302, 'The best or nothing', 2, 'I believe that i\'ll be useful for nation,religion and almamater', 2),
('R3501040', 35, 1, 6, 1201184051, 'Turn Your Scars Into Stars', 3.8, 'Sharing my skills and knowledge with beautiful minds', 2),
('R3501041', 35, 1, 6, 1201184093, ' Don\'t die before it\'s meaningful', 2.66, 'My motivation to follow this is that I am very interested in manufacturing especially the background of my family struggling with machinery so I am motivated to participate in the recruitment of manufacturing process assistants. And I really like to discuss and learn anything that is manufacturing or workshop.', 2),
('R3501042', 35, 1, 6, 1201180349, 'be better than before', 3.18, 'i want to be a successful person, in personality and wealth', 0);
INSERT INTO `oprec_general` (`id_oprec_gen`, `id_oprec`, `id_major`, `id_lab`, `nim`, `motto`, `gpa`, `motivation`, `oprec_status`) VALUES
('R3601001', 36, 2, 12, 1202174114, 'Fall seven times, stand up eight', 3.51, 'ingin belajar lebih tentang jaringan, infrastruktur jaringan dan saya ingin ilmu yang saya peroleh berguna baru diri saya maupun orang lain, serta sebagai karir saya kedepannya.', 2),
('R3601002', 36, 2, 12, 1202170190, '	Tetap tenang dan terus lakukan usaha terbaik', 3.55, 'saya tertarik dengan jaringan dan saya mau memberi tahu bahwa jaringan menantang. dengan saya mendaftarkan diri sebagai asisten praktikum, saya berharap dapat menjadi langkah selanjutnya dalam mengembangkan softskill saya.', 2),
('R3601003', 36, 2, 12, 1202174259, 'Jangan takut dengan kegagalan', 3.47, 'Motivasi saya agar bisa mengajarkan kepada adik adik tentang ilmu yang saya punya, dan bisa belajar lebih lagi baik dalam organisasi maupun akademik dari kaka kaka tingkat dan karena saya suka dan minat dalam bidang ini.', 2),
('R3601004', 36, 2, 12, 1202170229, 'do good and good will come to you', 3.14, 'Motivasi saya dengan keikutsertaan saya dalam Laboratorium SISJAR ini bisa belajar untuk bersosialisasi dan beroraganisasi dengan baik, bekerja sama, loyalitas dan juga menjalin kontak dengan sesama perserta dan terutama Asisten lainya dan terus menggali potensi kerja sama dan kolaborasi untuk mencapai tujuan yang akan diraih. Sehingga dapat mengembangkan softskill yang saya miliki serta memperluas wawasan dan lingkup pergaulan selama berada di Universitas Telkom khusus nya di jurusan saya sendi', 2),
('R3601005', 36, 2, 12, 1202174175, 'Bermanfaat dan berbagi semampu yang saya bisa dan taat kepada Allah', 3.68, 'untuk motto masuk asprak karena ingin ilmu yang saya punya dapat di nikmati oleh banyak orang dan juga sebagai ajang untuk saya memperluas dan memperdalam ilmu itu,karena jika kita membagikan ilmu berarti kita harus bertanggung jawab atas ilmu itu sendiri', 2),
('R3601006', 36, 2, 12, 1202174313, 'Long life Education', 3.64, 'multiply and add insight in the field of network configuration', 2),
('R3601007', 36, 2, 12, 1202172064, 'God Does not Charge a soul except its capacity', 3.59, 'To deliver the knowledge to our brother about computer network management, and bringing new innovations at teaching', 2),
('R3601008', 36, 2, 12, 1202174201, 'Jadilah Manusia yang bermanfaat', 3.68, 'Motivasi saya, yaitu ilmu yang saya miliki bisa berguna untuk orang - orang.', 2),
('R3601009', 36, 2, 12, 1202170265, 'I don\'t want to be perfect, just want to be the best', 3.21, 'Allah karena untuk ini saya berniat untuk melakukan ibadah hanya untuk Nya . Keluarga karena telah mensupport saya untuk menjadi lebih baik dan saya ingin memperdalam pengetahuan tentang jaringan dan ingin menerapkan pengetahuan yang didapat sebelumnya di semester terakhir kepada para calon praktisi untuk lebih memahami pengetahuan yang saya sampaikan.', 2),
('R3601010', 36, 2, 12, 1202172373, 'Hidup hanya sekali hiduplah yang berarti', 3.64, 'Untuk mendapatkan ilmu dan pengalaman, terutama dapat menyampaikan ilmu yang kita ketahui ke orang lain merupakan suatu hal yang bermanfaat dan dapat mengasah pengetahuan kita agar tidak mudah lupa, menambah wawasan lebih dalam dan pasti memiliki waktu lebih banyak untuk memelajarinya bersama orang-orang yang memiliki ilmu lebih tinggi dari saya. Selain itu bisa melatih softskill seperti public speaking dalam menyampaikan materi kepada praktikan secara baik dan benar, melatih teamwork', 2),
('R3601011', 36, 2, 12, 1202174269, 'Anda tidak tau apa yg terjadi hari esok, maka berbuatlah sebaik mungkin tuk hari ini', 3.22, 'Saya tertarik menjadi Network Engineer di masa depan. Ketertarikan ini di landasi keinginan saya menjadi seorang yang mampu mengembangkan minat saya dibidang jaringan. Tujuan saya mendaftar adalah untuk belajar lebih banyak dan juga sebagai bagian karir saya kedepan. Tujuan kedua saya adalah untuk mendapatkan pengalaman tambahan. Disamping itu dengan masuknya saya dalam lab ini saya berharap agar ilmu yang saya peroleh berguna bagi saya maupun orang lain', 2),
('R3601012', 36, 2, 12, 1202174071, 'be a strong wall in the hard times and be a smiling sun in the good times', 3.03, 'motivasi saya mengikuti asisten praktikum untuk bisa membagikan ilmu yang saya punya tentang jaringan kepada adik-adik,serta belajar untuk mendapatkan ilmu yang baru agar saya bisa mengembangkan skill saya di bidang jaringan. ', 2),
('R3601013', 36, 2, 12, 1202170044, 'Tidak ada usaha yang mengkhianati hasil', 3.65, 'Motivasi untuk menjadi asisten praktikum ialah karena ingin memanfaatkan kesempatan selama masa kuliah sebaik mungkin, terus mengembangkan ilmu dengan learning by teaching sehingga ilmunya tidak hanya bermanfaat bagi saya sendiri tetapi bagi orang lain juga. Penyesalan datang bukan karena apa yang sudah saya lakukan tetapi justru menyesal apabila saya tidak pernah mencobanya.', 2),
('R3601014', 36, 2, 12, 1202174084, 'Life must be balanced, if not like walking on one leg', 3.82, 'Ingin mengajar dan berbagi ilmu lagi karena menurut saya dengan berbagi ilmu dan menyampaikan ke orang lain itu lebih bermanfaat dan dapat selalu diingat', 2),
('R3601015', 36, 2, 12, 1202170063, 'tidak ada masalah dengan kata masalah ', 3.49, 'Ingin menyalurkan ilmu yang sudah di dapatkan kepada orang lain , serta ingin menjadi pribadi yang lebih bermanfaat. karena sebaik-baik manusia adalah yang paling bermanfaat bagi manusia ', 2),
('R3601016', 36, 2, 12, 1202170323, 'Don’t kneel, don’t cry, raise your hands !', 3.67, 'i want to challenge my self to be better person.', 2),
('R3601017', 36, 2, 12, 1202174181, 'eat well live well', 3.83, 'saya yakin saya bisa karena saya ingin mencoba lebih di praktkum manjarkam selanjutnya', 2),
('R3601018', 36, 2, 12, 1202174151, 'Bercita- citalah setinggi mungkin dan raih dengan sungguh- sungguh. Apabila kita jatuh, kita akan mendapatkan hal yang tidak jauh dari yang diinginkan.', 3.71, 'Nilai praktikum manjarkom yang kecil, membuat saya ingin belajar dan bisa mengimplementasikan cisco dengan tepat', 2),
('R3601019', 36, 2, 12, 1202174351, 'ingat selalu kita diciptakan untuk apa', 3.15, 'Apa yang dilakukan harus bermanfaat', 2),
('R3601020', 36, 2, 12, 1202170188, 'Work Hard Without regret', 3.62, 'motivasi saya adalah karena saya merasa pantas untuk mengajar mahasiswa-mahasiswa lain dalam meraih impian yang dia ingin, dan juga berkat bantuan temanku aku makin termotivasi untuk melakukannya tanpa penyesalan', 2),
('R3701001', 37, 2, 12, 1202164121, 'Be gentle with yourself, you are doing the best you can', 3.69, 'Selaku asisten laboratorium lab sisjar maka saya harus bisa memberikan ilmu kepada praktikan/adik tingkat, sehingga motivasi saya yaitu agar dapat meningkatkan kualitas praktikum KSI', 2),
('R3701002', 37, 2, 12, 1202160251, 'Jika orang lain bisa, saya harus lebih bisa', 3.77, 'Saya mendaftar sebagai Asisten Praktikum kali ini agar ilmu saya di bidang KSI tidak sia-sia, sehingga dapat memberikan ilmu ke teman-teman dengan baik dan benar. selain itu saya juga bisa bertemu teman-teman praktikan sehingga saya dapat belajar juga dari mereka.', 2),
('R3701003', 37, 2, 12, 1202160045, 'Man Jadda Wa Jadda', 3.64, 'Motivasi saya ingin mendaftar sebagao asisten praktikum agar bias memberikan ilmu kepada sesame dan menambah pengetahuan.', 2),
('R3701004', 37, 2, 12, 1202164225, 'Do good things, as you can, as you have the opportunity', 3.63, 'I want to execute my innovations in KSI\'s module', 2),
('R3701005', 37, 2, 12, 1202164314, 'Do What You Love and Love What You Do', 3.53, 'Ilmu adalah aset yang berharga untuk kita sebagai umat manusia sehingga kita sebagai manusia harus memiliki ilmu. Ilmu yang kita miliki haruslah ilmu yang bermanfaat untuk diri sendiri dan orang lain. Agar ilmu itu harus bermanfaat untuk orang lain, maka kita perlu membagikan ilmu tersebut ke orang yang membutuhkannya. Ilmu yang bermanfaat untuk orang lain nantinya akan menjadi ladang pahala (amal jariyah) untuk diri kita apabila kita memberikannya dengan ikhlas dan bersungguh-sungguh.', 2),
('R3701006', 37, 2, 12, 1202160145, 'Mengerjakan sesuatu dengan kemampuan terbaik saya', 3.31, 'Ingin menyalurkan pengetahuan saya tentang KSI dan membantu memberikan pemahaman yang baik tentang KSI kepada praktikan', 2),
('R3701007', 37, 2, 12, 1202160380, 'If you don\'t fight for what you love, then don\'t cry for what you\'ll lose', 2.69, 'I am always interested in computer security even from young age. I always follow new technologies and information security news. After studying them in university, I am getting even more interested in computer security and would like to share what I already know to other people. I seek new experiences and enjoy observing people around me growing. I enjoy doing computer forensics, because it feels like playing a puzzle board. And I believe in SISJAR Laboratory I can do something good and useful w', 2),
('R3701008', 37, 2, 12, 1202163259, 'Memanfaatkan setiap kesempatan yang ada untuk menjadi bahan pengembangan diri', 3.73, 'Mendukung inovasi baru dalam menjalankan praktikum Keamanan Sistem Informasi 2020', 2),
('R3701009', 37, 2, 12, 1202162175, 'It doesn\'t matter how I was born, the most important thing is what attitude I live.', 3.6, 'I want to improve my quality in the scope of networking and operating systems and also share the knowledge that has been gained with others who needs.', 2),
('R3701010', 37, 2, 12, 1202164284, 'Menjadi bermanfaat bagi orang lain, karena akan memberikan dampak positif untuk diri sendiri', 3.51, 'Saya ingin membagikan ilmu yang sebelumnya sudah saya dapatkan mengenai materi Dasar Sistem Operasi ini agar dapat dipahami juga oleh praktikan sehingga saya bisa menjadi orang yang bermanfaat seperti life motto saya', 2),
('R3701011', 37, 2, 12, 1202164029, 'Sebuah ilmu itu harus dibagikan bukan di pendam diri sendiri', 3.36, 'Mulailah dari tempatmu berada. Gunakan yang kau punya. Lakukan yang kau bisa.', 2),
('R3701012', 37, 2, 12, 1202160299, 'The road success comes through hardwork, determination and sacrifice', 2.96, 'Believing in yourself.\r\n', 2),
('R3701013', 37, 2, 12, 1202163115, 'Banyak jalan untuk mencapai tujuan, jangan hanya mengandalkan dari satu jalur saja, cobalah dari banyak jalur, agar tujuan bisa tercapai, dan Kerja Cerdas diiringi dengan doa.', 3.37, '1. Ingin belajar lebih dalam tentang Jaringan, khususnya Keamanan Sistem Informasi\r\n2. Ingin belajar bagaimana cara bekerja sama agar dapat mencapai tujuan\r\n3. Ingin berbagi ilmu ilmu yang sudah saya dapatkan dari Pelajaran dikelas maupun dari Praktikum agar bermanfaat bagi orang lain\r\n4. Ingin melanjutkan apa yang sudah saya mulai sejak menjadi Assisten Praktikum SISOP', 2),
('R3701014', 37, 2, 12, 1202164007, 'I used this motto when I was a participants of SISJAR recruitment assistant, my motto is ', 3, 'Mengembangkan Praktikum KSI, agar lebih kreatif dan lebih teliti dalam membuat modul  dikarenakan saya dulu juga mempunyai pengalaman menjadi asisten.', 2),
('R3701015', 37, 2, 12, 1202160382, 'If you can\'t be the best, don\'t be the worst', 3.66, 'Don\'t regret the past, focus on the future and keep updated with current issue because technology continues to grow', 2),
('R3701016', 37, 2, 12, 1202164039, 'Innal amra kullahu lillah', 3.7, 'Share your knowledge.\r\nIt’s a way to achieve immortality.', 2),
('R3701017', 37, 2, 12, 1202164334, 'ulah keok samemeh dipacok', 3.11, 'I want to deepen more about information system security and want to add experience and new insights', 2),
('R3701018', 37, 2, 12, 1202164350, '\"Life is a choice, no matter who you are, you are the one who can save yourself\"', 3.41, 'My motivation in applying this position is to earn a wide knowledge of cyber security and it\'s implementation.', 0),
('R3701019', 37, 2, 12, 1202163119, 'Practice makes perfect', 3.31, 'Make it count', 0),
('R3701020', 37, 2, 12, 1202164345, 'learn from mistake then fix it forward', 3.06, 'i want to improve my skill and also gain experience for applying this position', 0);
